    <div className="article-page">
        <ReadOutlined className="read-icon ica1" /><h1 className="home-head" style={{display:"inline", textAlign:"center"}}>Articles</h1><ReadOutlined className="read-icon ic2" />
        <ArticleList articles={articleContent}/>
    </div>
);
export default ArticleListPage;
